PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "retail_items" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "category" varchar(255) NULL, "number" integer NULL, "display_name" varchar(255) NULL, "norm_name" varchar(255) NULL, "price" decimal NULL, "cost" decimal NULL, "vat_category" varchar(255) NULL, "vat_rate" decimal NULL, "product_category" varchar(255) NULL, "supplier_name" varchar(255) NULL, "active" bool NULL, "registration_date" datetime NULL, "update_date" datetime NULL, "seller_id" bigint NULL REFERENCES "sellers" ("id") DEFERRABLE INITIALLY DEFERRED);
COMMIT;
